$tableSchema[] = "INSERT INTO `".PREFIX."_auto_marka_osn` (`id`, `name`, `desc`, `view`, `icon`) VALUES
(8, 'Acura', '<p>Марка &laquo;Acura&raquo; появилась в 1989 г. &ndash; под этим названием выпускаются престижные модели Honda, продаваемые на территории США. Технические данные автомобилей марки Acura, как правило, не отличаются от соответствующих параметров моделей Honda. Большая часть моделей производится непосредственно в Северной Америке (серии CL и TL), а отдельные модели &ndash; RL и NSX из-за невысокого спроса ввозятся из Японии.&nbsp;<br /><br />Основное отличие моделей марки Acura от аналогичных автомобилей Honda &ndash; спортивный облик и более высокий уровень серийной комплектации. Кроме этого, Acura представляет в США более престижные модели TL и RL2, которые Honda не предлагает американцам.&nbsp;<br /><br />В эмблеме марки использована стилизация буквы &laquo;А&raquo;, напоминающая металлические щипцы.</p>', '169', '/templates/66-reborn/auto/images/acura.gif'),
(10, 'Alfa Romeo', '<p>В 1906 году в Милане основали заводик по сборке французских такси Darracq. Но бизнес не пошел, и вскоре предприятие отошло всеядным итальянским банкирам, переименовавшим его в звучное &laquo;A.L.F.A&raquo; (аббревиатура от Anonima Lombarda Fabrica Automobili). Для сооружения авто новые хозяева пригласили инженера Джузеппе Мерози, и в 1910 году он представил свою первую &laquo;Альфу&raquo; &ndash; скромную 24 HP, названную в честь своего 4-цилиндрового двигателя в 24 &laquo;лошадки&raquo;. <br /><br />Пять лет фирма скромно росла, но все изменила Первая мировая война. Спрос на авто резко упал и завод встал. В этот роковой момент на сцене появился настоящий Ромео. Не в пример шекспировскому романтику делец из Неаполя Николо Ромео слыл ловким малым - под его началом на &laquo;ALFA&raquo; посыпались лакомые военные заказы. <br /><br />Став владельцем итальянской фирмы, Ромео переименовал ее в свою честь. Говорят, что неаполитанец не питал особой страсти к авто, а просто делал бизнес. Сначала ALFA попыталась освоить нишу дорогих представительских машин, но, встретив мощную конкуренцию, обратилась к спортивным моделям. Вскоре вокруг предприятия сложилась команда сильных гонщиков, среди которых была и будущая знаменитость &ndash; Энцо Феррари. <br /><br />В 20-е годы всем нужны были скорость и мощь, так что фирма попала в струю. Не последнюю роль в судьбе марки сыграл Муссолини. Его идеология погони за победой и силой породила моду на совершенные авто и подстегнула строительство современных автотрасс. Когда Alfa Romeo настиг мировой кризис, марку, по сути, спасли амбиции фашистов. В 1934 году правительство включило фирму в государственный концерн &laquo;IRI&raquo; (Институт индустриальной реконструкции), превратило мастерские в современный промышленный комплекс и начало спонсирование гоночного направления. <br /><br />К началу 30-х автомобили нового главного конструктора Витторио Джано &ndash; шестицилиндровые 6С1750, восьмицилиндровые 8C2300 и 8C2900B &ndash; стали королевами гонок. Погоня за мощью вызвала к жизни настоящих монстров. Так, гоночные машины Tipo A начали оснащать сразу двумя двигателями. <br /><br />В 1935 году в сакральном для нацистов Нюрнберге легендарный Тацио Нуволари из &laquo;Scuderia Ferrari&raquo; на двухмоторной &laquo;Альфе&raquo; &laquo;сделал&raquo; арийские Mercedes и Auto-Union. Это была красивая, но мимолетная победа. Если в 1931&ndash;1934 Alfa Romeo приходили первыми на всех гонках &ndash; &laquo;Mille Miglia&raquo;, &laquo;Le-Mans&raquo; и &laquo;Targa Florio&raquo;, то во второй половине 30-х новые &laquo;немки&raquo;, сочетавшие надежность с мощью окончательно изгнали машины Alfa Romeo почти со всех спортивных высот. <br /><br />Поражения бесили Муссолини, и это трясло фирму, прочно впаянную в госструктуру. В конце 30-х &laquo;Альфу&raquo; покинули Витторио Джано и Энцо Феррари. И все же именно в 30-е в дорожных версиях &laquo;Альф&raquo; закрепилось то сочетание прыти с грацией, которое на долгие годы станет путеводной звездой Alfa-Romeo: мощь двигателя, но женственность линий, спартанство, но роскошь, легкость и грация. Именно такими запомнятся вариации Alfa-Romeo 6С2500. <br /><br />В войну миланский завод честно снабжал фашистов авиамоторами, грузовиками и внедорожниками, а его конструкторское ядро продолжало работать над гражданскими моделями. Хотя в 1944 г. англо-американцы разбомбили завод в пух и прах, господдержка 30-х позволила фирме скопить силы для послевоенного рывка. Уже в 1945 году Alfa-Romeo попыталась вернуться в свет. Штучные модели с кузовами лучших ателье на базе довоенной Alfa 6С2500 &ndash; Super Sport, Freccia d`Oro и Villa d&rsquo;Este повсеместно имели оглушительный успех, а на гонках в отсутствие &laquo;Альфы&raquo; почувствовали себя полными хозяевами. <br /><br />Настоящий расцвет пришел с наступлением Alfa на рынок массовых авто. В 1950 году возрожденный на американские кредиты завод выдал седан Alfa 1900, сочетавший доступность с возможностью погоняться всласть, а в 1954 году увидела свет Giulietta с 4-цилиндровым двигателем объемом 1.3 литра. Именно с ней Alfa Romeo стала символом сладкой жизни новой Италии с ее вечными праздниками, любовными комедиями и гонками по горным серпантинам и улочкам старых городов. <br /><br />Интересно, что в послевоенные годы Alfa Romeo осталось предприятием в системе государственного концерна &laquo;IRI&raquo;. То, что фирме при этом удалось сохранить индивидуальность, конкурентоспособность и дерзость &ndash; парадокс. Такой же парадокс, как сама послевоенная Италия, страна, сделавшая за полвека тотальной коррупции, чехарды правительств и вакханалии левых с правыми фантастический рывок вперед, словно настоящее спортивное авто. <br /><br />С 1986 года марка Alfa-Romeo входит в состав крупнейшего итальянского концерна FIAT и продолжает производить спортивные и харизматичные автомобили.</p>', '318', '/templates/66-reborn/auto/images/alfa.gif'),
(11, 'Alpina', '&laquo;Alpina Burkard Bovensiepen&raquo; - немецкая компания, специализирующаяся на выпуске малых серий элитных тюнинговых автомобилей на базе моделей концерна BMW.&nbsp;<br /><br />Компания основана в 1964 году Буркартом Бовенсайпеном как тюнинговая контора. Однако мастера Alpina часто говорят о себе: &laquo;Мы строим автомобили&raquo;. Специалистами Alpina &laquo;доводится до ума&raquo; весь модельный ряд BMW. Фирмой выпускается около 600 эксклюзивных авто в год. От BMW специалисты тюнинговой конторы получают кузова и моторы в разобранном виде (в коробках), и лишь потом Alpina самостоятельно собирает автомобили. Внешне особых отличий от заводских &laquo;биммеров&raquo; иногда и не видно, кроме обязательных для всех Alpina легкосплавных дисков, эффектных спойлеров спереди и сзади, золотистой аппликации вдоль бортов кузова и фирменных шильдиков. Модели завода Alpina, как правило, укомплектованы самыми последними достижениями в области техники. Таким образом, компания Alpina выпускает автомобили, которые являются транспортными средствами с улучшенной отделкой и прекрасно отлаженной мат. частью.', '99', '/templates/66-reborn/auto/images/alpina.gif'),
(12, 'Alpine', 'Бренд &laquo;Alpine&raquo; создал гонщик Жан Редель в 1954 году и под этой маркой выпускали автомобили, исключительно с кузовами купе. Колыбелью марки &laquo;Alpine&raquo; стал портовый городок Дьепп, что в 150 км на северо-запад от Парижа. Здесь располагалась скромная автомастерская, в конце 40-х унаследованная 24-летним Жаном Ределе от своего отца. На первых порах дела у начинающего бизнесмена шли туговато, поскольку процесс послевоенной автомобилизации Франции еще не набрал оборотов. Для формирования первоначального капитала мсье Редель организовал ремонт армейской автотехники. И стал терпеливо копить сантимы и франки, чтобы в один прекрасный день реализовать свою давнюю мечту.&nbsp;<br /><br /><br />Первый автомобиль Alpine был построена на базе Renault 4CV, но имя себе компания сделала на другой модели &ndash; A110 1962 года с заднерасположенным двигателем. При этом продавались машины во всех салонах Renault. Триумфальное шествие модели А110 началось в 1970 году с побед гонщика Жан-Люка Терье в мировом чемпионате по ралли в Акрополисе в Сан-Ремо и Бернара Дарниша на Корсике. В январе следующего года в Монте-Карло добился успеха новый гонщик команды Alpine - швед Уве Андерсон, а его коллеги - мсье Терье и Жан-Клод Андрэ - заняли на этом этапе соответственно второе и третье места. После дальнейших побед в Акрополисе, Сан-Ремо и швейцарском Альпийском ралли в сезоне 1971-го А110 принес Alpine первое место в чемпионате производителей. В 1973 году автомобиль А110 еще раз доказал свое превосходство, блестяще выступив в Монте-Карло, Португалии, Сан-Ремо, Марокко, на Корсике и Акрополисе. К этому времени концерн Renault выкупил значительную долю акций Alpine - теперь легендарные скороходы стали именоваться Alpine-Renault.&nbsp;<br /><br /><br />Хотя основное производство автомобилей по-прежнему находилось в Дьеппе, их сборка велась также в Испании, Мексике, Бразилии и даже Болгарии. Интересно, что продукция Alpine в зависимости от своего, так сказать, происхождения имела отличительные национальные особенности. Например, кузов испанской стодесятки изготавливался из более толстого стеклопластика, что диктовалось спецификой дорог Пиренейского полуострова. В свою очередь А110 французской сборки имел самое надежное электрооборудование. Последний экземпляр стодесятки &mdash; модификация А110 1600 SX с 95-сильным двигателем от Renault 16 ТХ &mdash; был собран в июле 1977 года, когда Renault уже стала полноправным владельцем Alpine. Вслед за А110 появилась модель А310.&nbsp;<br /><br /><br />В начале 80-х годов прошлого века компания разработала модель GTA, которая была похожа на A310. Её выпускали небольшими партиями, но затем конкуренция стала ужесточаться и марка попросту не выжила - в 1994 году бренд &laquo;Alpine&raquo; канул в лету.', '96', '/templates/66-reborn/auto/images/alpine.gif'),
(13, 'Aro', 'Румынская компания, производитель полноприводных автомобилей и легких грузовиков на их базе. В 1953 году завод в Румынии начал собирать первые румынские мотоциклы. Производство автомобилей стартовало в 1957 г. с модели IMS-57.&nbsp;<br /><br />Сейчас фирма работает преимущественно на внутренний рынок. Продукция ARO не обновляется уже много лет, и все новые модификации этих машин созданы одним и тем же способом - установкой на базовые шасси импортных силовых агрегатов и других комплектующих изделий. В результате выпускаемая продукция существенно отличается друг от друга, так как каждый автомобиль собирается фактически по индивидуальным заказам.&nbsp;<br /><br />Небольшой спрос на машины фирмы &laquo;ARO&raquo; связан с устаревшей производственной программой. В настоящее время, по информации из некоторых источников, известно, что компания &laquo;ARO&raquo;, во главе с Джоном Пересом из США, находится на пороге банкротства и идут переговоры о её продаже.', '134', '/templates/66-reborn/auto/images/aro.gif'),
(14, 'Asia', 'В 1965 году в Южной Корее (г. Сеул) была основана &laquo;Asia Motors&raquo; - компания по производству военных автомобилей. В 1965 г. по лицензии был собран первый внедорожник М-38А1. Первоначально авто повторяли конструкцию американского военного Jеер и изготовлялись только для армии.&nbsp;<br /><br />В 1976 г. Asia Motors вошла в концерн Kia, которая сохранила ее наименование для своих джипов и грузовиков, и наряду с легковыми автомобилями Kia на своем дочернем предприятии стала выпускать внедорожники Аsiа.&nbsp;<br /><br />С 1994 г. автомобили Аsiа начали поступать в открытую продажу, также начался экспорт на внешние рынки.&nbsp;<br /><br />В 1997 на автошоу в Сеуле была представлен модернизированная внедорожник под названием Asia Motors Retona, производство которого началось в 1998 г. В 1997 г. производство компании составило около 200 000 автомобилей.&nbsp;<br /><br />В настоящее время новым владельцем Asia Motоrs является южнокорейская компания Hyundai Motor.&nbsp;<br /><br />В Европе компания Asia известна своими легкими и недорогими внедорожниками Rocsta. Предлагается Rocsta в классическом старомодном стиле Jeep CJ, а также есть новая Rocsta R2. Обычная Rocsta предлагается в вариантах &laquo;Soft Top&raquo; (съёмный мягкий верх) и &laquo;Hard Top&raquo; (съёмный жесткий верх). Более современная модель Retona в некоторых европейских странах продается как Kia Retona.&nbsp;<br /><br />Кроме этого Asia Motors выпускает также серию легких фургонов Hi-Topic AM725 в вариантах: фургон, грузопассажирский, микроавтобус, рефрижератор. На рынке Южной Кореи также представлены фургоны и пикапы, средние и тяжелые грузовики, седельные магистральные тягачи, военные внедорожники и полноприводные грузовики.', '89', '/templates/66-reborn/auto/images/asia.gif'),
(15, 'Aston martin', '<p>Основоположниками марки называют Лайонела Мартина и Роберта Бамфорда, которые в 1914 году в лондонском районе Кенсингтон построили легкий спортивный автомобиль с 1.4-литровым двигателем Coventry-Simples на шасси итальянского легкового авто Isotta Fraschini. За год до этого на автомобиле Zinger-10 Мартин одержал победу в местных гонках на холме Астон Клинтон и в память об этом событии новую машину назвали Aston Martin.&nbsp;<br /><br />В конце 1919 года появилась вторая модель Aston Martin, а ее производство началось лишь в январе 1920-го в новой мастерской на лондонской улице Абингтон Роуд.&nbsp;<br /><br />Автомобили Aston Martin постоянно участвовали в гонках, благодаря которым компания набирала спортивный и технический опыт. В 1924 году в гонке на Монце разбился граф Луи Зборовски, оказывавший компании огромную финансовую помощь, и фирму, стоявшую на грани банкротства, выкупил за 6 000 фунтов стерлингов инженер Ренуик. Основой для всех последующих автомобилей Aston Martin до 1936 года был новый 1.5-литровый мотор с верхним распределительным валом, которой разработали Ренуик и его компаньон итальянец Аугусту Чезаре Бертелли.&nbsp;<br /><br />В 1939 году главный инженер компании Клод Хилл создал автомобиль Atom, с которого началась история автомобилей серии DB. В 1940 году на моторшоу в Лондоне Atom произвел настоящий фурор. Но война внесла свои коррективы.&nbsp;<br /><br />В 1947 компанию Aston Martin выкупает англичанин Дэвид Брау владелец крупной промышленной компании по изготовлению тракторов и сельхозтехники, и в 1948 на основе модели Atom выпускается первый DB. В собственность Брауна так же попала марка Lagonda, таким образом, её мотор достался Aston Martin. Всего было выпущено 15 автомобилей Aston Martin-Lagonda DB1.&nbsp;<br /><br />В 1950 состоялся дебют DB-2 с двигателем 2.6 литра мощностью 105 л.с., удачно участвовавший во многих соревнованиях для автомобилей 3-литрового класса.&nbsp;<br /><br />В 1959 году компания Aston Martin представила DB4 с алюминиевым 6-цилиндровым мотором рабочим объемом 3.7 л. с двумя верхними распределительными валами мощностью 240 л.с., разработанный конструктором Тадеком Мареком. Обновленный легкий кузов купе имел более элегантную и привлекательную форму. Это был самый удачный автомобиль категории &laquo;гран-туризмо&raquo; среди британских автомобилей. Внушительная четырехместная модель DBS могла развивать скорость 257 км/ч.&nbsp;<br /><br />В 1959 автомобиль DB-R3 одержал победу на 24-часовых гонках в Ле-Мане.&nbsp;<br /><br />В 1963 году было объявлено о выпуске нового DB5, который отличался от предшественника только увеличенным до 4 л. рабочим объемом двигателя мощностью 282 л.с.&nbsp;<br /><br />Последовавший за Aston Martin DB5 в 1965 году 325-сильный DB6 был внешне похож на всех своих двухместных предшественников, но вмещал 4 человек. Он относился к высшему классу и был способен конкурировать с другими престижными моделями. В конце 60-х на его базе родились более мощные модели DBS и DBS Vantage c 6-цилиндровым двигателем, к которым позднее добавились машины с алюминиевым мотором V8 объёмом 5340 куб.см., развивавшим мощность от 340 до 450 л.с.&nbsp;<br /><br />В 1972 году произошел новый поворот в истории Aston Martin: Дэвид Брау продал ее фирме &laquo;Company Development Ltd&raquo;, поставившей точку на привычном обозначении моделей DB. В этот период компания с трудом собирала небольшие серии спортивных автомобилей, получивших обозначение Vantage для купе и Volante для кабриолетов. Все они предлагались в самых дорогих исполнениях с прежним 5.3-литровым двигателем V8 мощностью 340-390 л.с. На них появились первые системы прямого впрыска и американские автоматические коробки передач.&nbsp;<br /><br />С 1976 года небольшими сериями выпускался один из самых экстравагантных в мире автомобилей Aston Martin Lagonda высшего класса с удлиненным клиновидным капотом, под которым скрывалась уже известная &laquo;восьмерка&raquo; в 390 л.с. вместе с автоматической коробкой Chrysler. Этот автомобиль был не по карману простому обывателю, зато на Среднем Востоке Lagonda пользовалась большой популярностью. Так, например, одними из ее владельцев были Принц и Принцесса Саудовской Аравии.</p>\r\n<br />\r\n<p>С приходом 80-х годов финансовое положение Aston Martin ухудшилось. В течение 7 лет ее несколько раз перекупали английские и американские промышленные и финансовые группы, но и это не привело к существенным изменениям в делах фирмы. Относительная стабилизация наступила только в 1987 году, когда очередным хозяином Aston Martin стал американский концерн &laquo;Ford Motor Company&raquo;, купивший 75% акций фирмы.&nbsp;<br /><br />В 1988 к основной гамме выпускаемых моделей Vantage и Volante прибавилось новое купе Virage, сочетающее в себе дух моделей прошлых лет вкупе с ультрасовременным дизайном и великолепным новым шасси.&nbsp;<br /><br />В 90-е годы под опекой Ford экономическое положение Aston Martin улучшилось. В 1993 году публике был представлен новый спортивный DB7. Эта модель является одной из лучших машин компании. В 90-х годах были по-прежнему актуальны модели Virage, Volante и Vantage с существенно переработанным двигателем V8 с 4 клапанами на цилиндр и объемными нагнетателями, что позволило поднять его мощность до 557 л.с.&nbsp;<br /><br />Удачным проектом Aston Martin на автосалоне в Детройте 1998 стала новая модель DB7. Свой вклад в создание автомобиля следующего тысячелетия, который был назван Dream Choice, внес дизайнер Ян Каллум.&nbsp;<br /><br />В 1999 на Женевском автосалоне впервые было показано новое детище английских дизайнеров &ndash; Vantage Aston Martin DB7. Это еще один dream-car из модельной серии DB7. Дизайн нового DB7 Vantage был выполнен также Яном Каллумом.&nbsp;<br /><br />В 2000 г. владелец Aston Martin - американский автогигант &laquo;Ford&raquo; - официально представил модель Aston Martin V12 Vanquish, которая благодаря новому, более мощному двигателю и использованию легких материалов обладает потрясающими ходовыми характеристиками.&nbsp;<br /><br />В 2001 г. компания сообщила о выпуске четырехтысячного автомобиля модели Aston Martin DB7. Им стало купе Vantage, выкрашенное в серо-зеленый цвет Galloway Green.&nbsp;<br /><br />Стоит отметить, что элитные автомобили Aston Martin до сих пор собираются в четырех небольших гаражах, неподалеку от городка Ньюпорт-Пэгнел в центральной части Англии. Этот завод так и не узнал, что такое конвейер или разделение труда по Форду.</p>', '93', '/templates/66-reborn/auto/images/astonmartin.gif'),
(16, 'Audi', 'Немецкая марка &laquo;Audi&raquo; известна во всём мире уже около века. Фирма &laquo;Audi AG&raquo; родилась в 1910 году по решению суда. Рассматривалось дело об обвинении Августа Хорьха его бывшими коллегами из компании &laquo;Horch&raquo;. В результате разногласий с партнерами своенравный Хорьх был вынужден уйти из собственной фирмы, основанной им в 1899 году. Спустя некоторое время он создал в том же городе новую компанию, естественно, присвоив ей свое имя. Но недолго существовали в одном небольшом городке две фирмы с одинаковым названием: решением суда второй было присвоено новое название Audi, что по-латыни означает то же самое, что &laquo;Horch&raquo; по-немецки &ndash; слушать. <br /><br />До начала ВОВ Audi выпускала в основном незамысловатые автомобили. Однако специально подготовленные модели выигрывали многочисленные гоночные состязания. <br /><br />В 1950 году началось производство первого послевоенного легкового автомобиля &ndash; Auto Union DKW. Так как для производства машин в Ингольштадте не было достаточного количества производственных площадей, компания купила территорию в Дюссельдорфе, где до конца 1961 года и производилась модель DKW. <br /><br />В 1970 году начался экспорт автомобилей Audi в Соединенные Штаты. Сначала он ограничивался моделью Audi Super 90 (седан и универсал), а также новым Audi 100. С 1973 года к ним присоединился седан Audi 80, который, в отличие от европейского варианта, существовал и как универсал. Позднее модели Audi получили на рынке США собственные обозначения: Audi 4000 для Audi 80, Audi 5000 для Audi 100. <br /><br />В 1980 году в стенах компании родилась уникальная модель &ndash; Audi Quattro. Данная машина отличалась совершенной (для тех лет) полноприводной трансмиссией, современные модификации которой и сегодня является отличительно чертой многих моделей Audi. Появление массовых полноприводных Audi считается революционным этапом развития автомобилестроения. Первые Audi Quattro были рассчитаны, прежде всего, на спортивные соревнования, где можно было проверить надежность новых конструкций, однако под их влиянием было заложено новое направление в создании серийных машин, как для спорта, так и для обычной эксплуатации. <br /><br />С 90-х годов прошлого века развитие марки Audi шло быстрыми темпами. Немецкая компания одну за другой выпускала на рынок технические новинки, которые вызывали зависть у конкурентов: первый в мире алюминиевый кузов для серийного автомобиля (модель A8), совершенный вариатор с металлическим многорядным ремнём (модель A6), активные фары головного света и т.д. <br /><br />Сегодня фирма Audi, входящая в концерн VW, является одним из фаворитов мирового автомобилестроения. За многие годы за автомобилями Audi закрепились такие понятия как надёжность, техническое совершенство, удобство, стабильность и т.д<br />', '213', '/templates/66-reborn/auto/images/audi.gif'),
(17, 'Austin', 'Любители автоспорта наверняка вспомнят, что Austin - это, прежде всего, две знаменитые своими успехами на ралли и гонках модели Mini и 1800/2200, находящиеся на противоположных концах модельного ряда марки. Те, кто был в Лондоне, скажут, что Austin - это знаменитое лондонское такси весьма консервативного вида, считающееся лучшим в мире. Все они по-своему правы. Все модели фирмы Austin, которая основана лордом Гербертом Остином в 1895 г., - это компактные, но просторные внутри, удобные, практичные, прочные, экономичные и долговечные автомобили.&nbsp;<br /><br />На протяжении всего XX века компания Austin выпускала множество различных моделей и модификаций своих авто, но самой известной является Mini, которую строили с 1959 г.&nbsp;<br /><br />Austin Mini имела отличную маневренность и устойчивость. Спортивные версии модели становились неоднократными победителями в классическом ралли.&nbsp;<br /><br />При закрытии фирмы Austin в конце 80-ых годов прошлого века часть моделей решили не снимать с производства, а передать компании Rover.', '87', '/templates/66-reborn/auto/images/austin.gif'),
(18, 'Autobianchi', 'Компания считается наследником известной в прошлом машиностроительной компании &laquo;Bianchi&raquo;, основанной в конце прошлого века. В послевоенное время для производства легковых автомобилей в местечке Дезиро, под Миланом, построили новый завод, на базе которого 11 января 1955 года была образована новая фирма &laquo;Autobianchi&raquo; с капиталом в 3 миллиона лир. Это была коллективная собственность фирмы &laquo;Bianchi&raquo;, автомобильного концерна &laquo;FIAT&raquo; и шинной компании &laquo;Pirelli&raquo;. Каждому компаньону принадлежала одна треть Autobianchi.&nbsp;<br /><br />Начало деятельности Autobianchi относится к 1957 году, когда фирма впервые заявила о себе микролитражным автомобилем Bianchina, серийное производство которого началось с 1958 года. Это событие привело к финансовым осложнениям, и фирма &laquo;Bianchi&raquo; была вынуждена уступить свою долю двум другим участникам. Миниатюрная Bianchina принесла новой фирме успех, хотя с технической точки зрения была аналогом популярного FIAT-500. За первый год изготовили 11 000 машин. Шесть лет все производство держалось на Bianchina и ее вариантах, но спрос на такие микролитражки в середине 60-х начал резко падать. В конце 1964 года появилась оригинальная переднеприводная Primula - автомобиль более высокого класса с поперечным расположением мотора. Через год к нему добавилось купе. В различных модификациях Примула выпускалась до 1970 года.&nbsp;<br /><br />Полное присоединение Autobianchi к концерну FIAT состоялось в 1967 году, и вся последующая ее продукция технически тесно связана с различными автомобилями своего хозяина. В 1969-м появился седан А-111 малого класса с передним приводом. Несколько месяцев спустя в производство была запущена наиболее известная модель А-112, технически идентичная FIAT-127. Она оснащалась двигателями рабочим объемом 903 и 1050 см3. и выпускалась 15 лет. Тем временем в состав FIAT вошла фирма марка &laquo;Lancia&raquo;, а в 1975 году было решено присоединить к ней компанию &laquo;Autobianchi&raquo;.&nbsp;<br /><br />В 1985 году на Женевском автосалоне представили новую Autobianchi Y-10 - компактный трехдверный переднеприводный автомобиль, выпускавшийся с двигателями в 999, 1108, 1297 или 1301 см3. мощностью 45-78 л.с. и имевший привод, как на передние, так и на все колеса. В последние годы он предлагался одновременно под марками &laquo;Autobianchi&raquo; и &laquo;Lancia&raquo;. Имя Autobianchi исчезло после замены этого автомобиля в 1996 году на более современный Lancia Y, который представлял улучшенное исполнение модели Y-10 с более оригинальной формой кузова.', '94', '/templates/66-reborn/auto/images/autobianchi.gif'),
(19, 'Barkas', '...', '110', '/templates/66-reborn/auto/images/barakas.gif')";
$tableSchema[] = "INSERT INTO `".PREFIX."_auto_marka_osn` (`id`, `name`, `desc`, `view`, `icon`) VALUES
(20, 'Bedford', '<p>Автомобили &laquo;Bedford&raquo; относятся к наиболее известным английским грузовикам, хотя ни по внешнему виду, ни по оригинальности конструкции они никогда не выделялись среди всех остальных машин. На практике это были универсальные и неприхотливые рабочие лошадки, какие можно было встретить в любом уголке Британских островов и всего мира.</p>\r\n<br />\r\n<p>Первые годы существования марки Bedford связаны с известной машиностроительной и чугунолитейной компанией Vauxhall, основанной в середине прошлого столетия в лондонском квартале Воксхолл. В 1905 г. она переехала в город Лутон, графство Бедфордшир, где начала выпускать легковые автомобили. В трудные для фирмы 20-е гг. американский концерн GM, давно намеревавшийся создать в Великобритании свой плацдарм для вторжения на европейский рынок, заинтересовался компанией Vauxhall и в 1925 г. сделал ее своим британским филиалом. Планы по закреплению на европейском рынке охватывали также и сектор грузовых автомобилей. Деятельность в этом направлении началась с импорта в Великобританию грузовых машин Chevrolet, а в конце 20-х гг. на заводе в Хендоне началась их сборка.</p>\r\n<br />\r\n<p>В 1931 г. американское руководство решило развернуть в стране собственное производство легких грузовиков, приспособленных к требованиям британского рынка. Их маркой стал Bedford - по названию соседнего городка и всего графства, где находился завод. Новое производство стало грузовым отделением компании Vauxhall. Надежные и скоростные машины Bedford имели большой успех и вскоре сделались популярными на всех видах перевозок.</p>\r\n<br />\r\n<p>Первыми появились 2-тонные машины WHG и WLG с колесной базой 3330 и 3990 мм. соответственно, стоившие предельно дешево - всего 198 фунтов стерлингов; вслед за ними выпустили легкие фургоны VY и VX, 1.5-тонную серию WS и 3-тонные грузовики WT. На них устанавливали 6-цилиндровый верхнеклапанный бензиновый двигатель (3177 см3., 44 л.с., на серии WT - 64 л.с), редкую в то время в Европе 4-ступенчатую синхронизированную коробку передач.</p>\r\n<br />\r\n<p>Первым автомобилем Bedford собственной разработки стал в 1934 г. легкий фургон BYC грузоподъемностью 600 кг., признанный современниками лучшим развозным автомобилем своего класса.</p>\r\n<br />\r\n<p>Еще не успели развернуть серийное производство машин, как пришлось срочно переделывать их в армейские варианты. Основной стала серия &laquo;О&raquo;, на базе которой выпускали грузовики моделей OXD, OYD и OWS с полезной нагрузкой 1.5-5 т., получившие специфическую плоскую облицовку передней части, ставшую их своеобразным опознавательным знаком. Самым известным армейским вариантом серии &laquo;М&raquo; стал легкий пикап MWD грузоподъемностью 750 кг. С 1941 г. Bedford выпускал 3-тонную модель QLD (4x4) с кабиной над двигателем и 8-ступенчатой трансмиссией.</p>\r\n<br />\r\n<p>По окончании войны с конвейеров Bedford вновь стали сходить гражданские автомобили довоенной разработки.</p>\r\n<br />\r\n<p>В 1950 г. появилась первая новая разработка - так называемый &laquo;Большой Бедфорд&raquo; - 7-тонный грузовик серии &laquo;S&raquo; полукапотной компоновки с весьма элегантной для своего времени округлой кабиной с хромированной облицовкой радиатора. Через три года эту гамму предлагали в 4 вариантах: бортовые модели SSZ и SLZ с колесной базой соответственно 2.9 и 4.0 м., седельный тягач SA с базой 2.2 м., полноприводный грузовик R (4x4). В 1953 г. серию &laquo;О&raquo; заменила новая капотная 76-сильная гамма &laquo;ТА&raquo;, состоявшая из многочисленных моделей грузоподъемностью 1.25-5 т.&nbsp;<br />В 1952 г. произошло вроде бы неприметное событие в деятельности Bedford - в его программе впервые появился специально разработанный легкий фургон СА - полукапотной компоновки грузоподъемностью 500-750 кг., отличавшийся своеобразной внешностью. Автомобиль имел огромный успех и выпускался около 20 лет.&nbsp;<br />В 1958 г. капотная серия &laquo;ТА&raquo; была заменена новой &laquo;TJ&raquo;, дизайн которой был выполнен в прежнем стиле.&nbsp;<br />1960 г. для замены серии &laquo;S&raquo; представили принципиально новую гамму &laquo;ТК&raquo; грузоподъемностью 3-7 т. со сдвинутой вперед удлиненной и низкорасположенной кабиной. В ее задней части размещался двигатель мощностью 98-138 л.с.&nbsp;<br />В 1966 г. Bedford впервые ввел в свою программу тяжелые машины серии &laquo;КМ&raquo; полной массой до 24 т. с новым дизелем мощностью 143 л.с. Через два года появился вариант с колесной формулой 6x2, а в 1972 г. - седельный тягач для работы в составе автопоездов полной массой 32 т. К этому времени в конструкции английских автомобилей все сильнее стало ощущаться влияние внутренней кооперации среди членов концерна GM, включая европейское отделение Opel и частично принадлежавшую ему японскую фирму Isuzu.</p>\r\n<br />\r\n<p>Параллельно продолжалось совершенствование легких грузовых машин. В 1964 г. на базе популярных малолитражных автомобилей Vauxhall Viva началось изготовление фургонов и пикапов &laquo;НА&raquo; грузоподъемностью 300-500 кг. В 1969 г. известную серию &laquo;СА&raquo; заменила гамма &laquo;CF&raquo; с полезной нагрузкой от 900 кг до 1.75 т. В начале 80-х гг. появилась новая серия &laquo;CF2&raquo; из четырех моделей полной массой 2.3-3.5 т. с несущим кузовом, боковой сдвижной дверью и существенно измененным дизайном.</p>\r\n<br />\r\n<p>В 1980 г. к серии &laquo;ТК&raquo; добавили гамму &laquo;TL&raquo;, отличавшуюся более строгим дизайном и применением откидываемой кабины над двигателем. В 1986 г. наиболее мощный представитель этой гаммы - трехосный самосвал TL2440 (6x4) полной массой 24 т. - стал одним из последних автомобилей, носивших марку &laquo;Bedford&raquo;. Но, несмотря на экономическое отставание Великобритании, к 1980 г. положение Bedford оставалось достаточно благополучным. На его счету уже было 2 миллиона выпущенных грузовиков и еще 1 миллион различных фургонов. До 70% всей продукции поступало на экспорт в более чем 100 стран мира. Bedford оставался одним из ведущих изготовителей грузовых автомобилей в стране.</p>\r\n<br />\r\n<p>В 1986 г. пришлось принять болезненное решение об уходе Bedford с рынка тяжелых грузовиков. В ноябре 1987 г. завод в Данстэйбле, вместе с правами на выпускавшуюся гамму грузовиков, выкупила фирма &laquo;All Wheel Drive Ltd&raquo;. Ей удалось продолжить изготовление 2- и 3-осных машин серий &laquo;TL&raquo; и &laquo;ТМ&raquo; под маркой &laquo;AWD&raquo; всего лишь в течение 6 лет, после чего она разорилась. В 1992 г. марку Bedford возродила машиностроительная группа Marshall из Кембриджа, сделавшая производство грузовиков своим новым отделением.&nbsp;</p>', '100', '/templates/66-reborn/auto/images/bedford.gif'),
(22, 'Bentley', '<p>Компания &laquo;Bentley Motors&raquo;, созданная Уолтером Оуэн Бентли, открылась в Криклвуде на севере Лондона в 1919 году.</p>\r\n<br />\r\n<p>Основатель легендарной аристократической марки автомобилей У. Бентли свой первый автомобиль с 3-литровой &laquo;четверкой&raquo; разработал совместно с Ф. Барджесом и Г. Варлеем. Осенью 1919 года Уолтер Бентли показал своего первенца на автосалоне в Лондоне, но производство смог наладить только по прошествии двух лет. Кстати, с самого начала Бентли нацелился на производство престижных авто. Объем в три литра делал машину недосягаемой для рядовых автомобилистов, а уникальный для того времени гарантийный срок в пять лет привлекал внимание состоятельных людей. Машина носила незамысловатое имя &ndash; 3L, что означало наличие 3-литрового мотора. В дальнейшем данное обозначение стало традиционным. И только где-то с середины двадцатых годов в названии стали появляться слова, например, Big Six.</p>\r\n<br />\r\n<p>Бентли, не обременяя себя дизайнерскими изысками, уделял особое внимание технической стороне вопроса. Основное предназначение своих машин он видел в победах на автомобильных гонках. И действительно, редко случалось так, чтобы машины марки Bentley не выигрывали спортивных состязаний. Одной из таких была модель 4.5L с роторным нагнетателем Roots, размещенным перед радиатором. Эта машина была специально разработана для известного гонщика и промышленного магната Г. Биркина. В те годы машина стала одной из самых мощных и скоростных, и, несмотря на критичное отношение к ней со стороны самого Бентли, принесла его компании еще большую известность.</p>\r\n<br />\r\n<p>В 1928-30 гг. в небольших количествах собираются автомобили модели 6.5L и ее спортивный вариант Speed Six. За три года этот автомобиль дважды выигрывал гонки в Ле-Мане и трижды в Брукленде.&nbsp;<br />Выпуск модели 8L - самой дорогой и престижной в линейке компании - начался в 1930 г.&nbsp;<br />Начало тридцатых годов было ознаменовано потерей фирмы &laquo;Bentley&raquo; своей независимости. Так, при посредничестве фирмы &laquo;Napier&raquo;, Bentley вошла в состав другой элитной автомобильной компании &laquo;Rolls-Royce&raquo;. С этого начался новый этап в истории фирмы, который ничуть не принизил заработанный ранее престиж.</p>\r\n<br />\r\n<p>Первый Bentley, созданный совместно со специалистами Rolls-Royce, это модель 3.5L (1933 г.). В 1936 г. появляется модель 4.5L на базе Rolls-Royce 20/25НР и Rolls-Royce25/30 НР. Начиная с 1933 года было выпущено семь очень сходных по конструкции и дизайну моделей.</p>\r\n<br />\r\n<p>Постепенно производство автомобилей марки Bentley стало переезжать из Дерби на завод Rolls-Royce, находившийся в городе Крю. И первой полностью созданной моделью там стал Mark-VI, запущенный в производство через несколько месяцев после окончания II-й мировой войны. Базой для этой машины стал Rolls-Royce Silver Wraith. И уже с 1955 года все модели Bentley являлись копиями Rolls-Royce. Тем не менее, несмотря на конструктивную схожесть обеих марок, между ними было основное отличие: Rolls-Royce - это представительский автомобиль, а место его хозяина находится сзади. А Bentley, наоборот, авто для людей умеющих и любящих водить машину.</p>\r\n<br />\r\n<p>В 1980 состоялась презентация модели Mulsanne, через два года увидел свет 300-сильный вариант с турбонаддувом, а еще через пару лет - упрощенная версия Eight. Остальные модели создавались по так называемому проекту 90, с разными кузовами и некоторыми внешними отличиями от собратьев из Rolls-Royce - Turbo R и Brooklands, только модель Continental не имела и не имеет аналогов. Семейство этих дорогих спортивных купе в первую очередь предназначено для молодых и амбициозных миллионеров, которым спортивные авто типа Ferrari кажутся слишком утилитарными и лишенными комфорта. Ныне выпускаемые Continental имеют три основные модификации R, T и SC. Модель R является более дешевой в семействе (314 000 долларов) и отличается характерной отделкой, а также комфортной и в то же отлично настроенной на быструю езду подвеской. Модель Т имеет укороченную на 100 мм базу, более спортивную подвеску и мощный движок в 426 л.с. Но самым интересным из этой оперы является модификация SC (Sedanca Coupe) с жесткой убирающейся крышей. В обычном состоянии - это закрытое купе, однако, при желании часть крыши над передними сидениями автоматически убирается.</p>\r\n<br />\r\n<p>В 1998 году изменения в автомобильном мире привели к тому, что компания &laquo;Bentley Motors&raquo; перешла под контроль &laquo;Volkswagen AG&raquo;.&nbsp;</p>', '97', '/templates/66-reborn/auto/images/bently.gif'),
(23, 'Bertone', '<p>Основатель фирмы Джованни Бертоне родился в 1884 г. в маленьком городке Мандови. В 1907 г. он переехал в Турин и довольно быстро включился в деловую жизнь неофициальной столицы итальянской промышленности. Пять лет Бертоне сотрудничал с фирмой &laquo;Diatto&raquo;, а в 1912 г. решил открыть собственное дело. Так, в небольшой мастерской по улице Вилларбассе, 32 стали ремонтировать и строить экипажи. В том же году в семье Бертоне родился сын Джузеппе, которого, однако, все называли Нуччо. Под этим именем он и войдет в историю мирового автомобильного дизайна ХХ века.</p>\r\n<br />\r\n<p>Семейное дело развивалось неспешно - примерно так же жили десятки подобных мастерских Турина и его окрестностей. Все изменилось, когда в 1921 г. Джованни построил кузов для автомобиля SPA 9000 Sport - свой первый кузов для автомобиля. Новый вид транспорта настолько его покорил, что Бертоне решает полностью переключиться на автомобили, да и маленького Нуччо никакими силами невозможно было оттащить от руля. Видя такое рвение к технике, отец начинает постепенно привлекать мальчика к делам мастерской. Когда Нуччо исполнилось 18 лет, он официально включился в семейный бизнес. К 1934 г. в его кармане уже лежал диплом бухгалтера, но ему хотелось совсем другого &mdash; создавать красивые автомобили. К этому времени мастерская Д. Бертоне приобрела некоторую известность благодаря отменному качеству заказных кузовов на шасси Lancia и Fiat. Что же касается стиля, то он еще не стал столь характерным и выразительным и, например, модель Arditta очень напоминала Ford 1934 г., а роскошные кабриолеты на шасси Fiat были выполнены под явным влиянием известного кузовщика Марио Ривелли.</p>\r\n<br />\r\n<p>Волна заказов заставила расширить производство. Нуччо очень бойко управлялся со 150 сотрудниками, и это еще больше укрепляло в отце уверенность, что из него получится отличный директор или, как сказали бы сегодня, дизайн-менеджер. Так потом и вышло, а пока Джованни решил постепенно отойти от дел, чувствуя, что век итальянских каретников закончился и будущее за промышленным производством, в котором молодое поколение ориентируется лучше.&nbsp;<br />Сразу после войны Нуччо строит завод в Грульяско под Турином, где в 1954 г. осуществляет свою первую коммерческую программу - проектирование и выпуск автомобиля Alfa Romeo Giulietta Sprint. 36 000 выпущенных машин принесли деньги, которые дали возможность участвовать с концептуальными моделями в заокеанских и европейских шоу. Именно с этого времени и начинается отсчет истории феномена, имя которому Bertone.</p>\r\n<br />\r\n<p>Свое творческое кредо Нуччо выразил в знаменитой серии концептов B.A.T. - Berlinetta Aerodinamica Tecnica (автомобиль с улучшенной аэродинамикой). Материализацию своего замысла он доверяет мало кому известному в то время инженеру Франко Скальёне, которому сначала (в виде своеобразного испытания) поручается проектирование Аbart Coupe для Туринского салона 1952 г. Именно с этого автомобиля берет начало европейский аэростиль, и теперь многие годы вдохновение дизайнеров будет питать атрибутика реактивных самолетов. Позже Скальёне проявится как удивительно тонкий художник и отличный стилист. Казалось, что он знает некую тайну, которая помогает ему творить чудеса из обычного стального листа. В этом, кстати, и одно из проявлений феномена Бертоне: кроме того, что маэстро обладал уникальным даром собирать вокруг себя талантливых людей, он также умел предвидеть моду и стиль, которые будут востребованы завтра.&nbsp;<br />Как и многие другие, Нуччо сразу начинает работать со спортивными автомобилями Ferrari, которые словно магнит притягивали стилистов из ателье &laquo;Pininfarina&raquo;, &laquo;Vignale&raquo; и &laquo;Ghia&raquo;. Кузова от Bertone, отличавшиеся от продукции других студий классической гармонией пропорций и изяществом линий, узнавались сразу. Всем этим фирма, безусловно, была обязана Скальёне, по проектам которого - всего за восемь лет работы с Нуччо - удалось создать более 40 моделей! Правда, большинство из них так и не смогло освободиться от романтической образности серии B.A.T., тем не менее, именно эти образцы и разработки превратили ателье из ремесленной мастерской в центр дизайна с промышленным производством автомобилей.</p>\r\n<br />\r\n<p>Следующий этап в истории Bertone начался с приходом на фирму в 1960 г. Джорджио Джуджаро, который всего за пять лет работы в студии не только нашел свой собственный почерк и стиль, но и сумел выработать тот неповторимый лаконизм, чистоту и ясность рисунка, которые будут впредь отличать продукцию ателье. Однако Джуджаро, хотя и занимался концептами, явно тяготел к дизайну массовых автомобилей. И вскоре он создаст свою студию &laquo;Italdesign&raquo;, которая начнет работать с такими гигантами, как Fiat, Volkswagen или Daewoo. А пока Джуджаро проектирует для Bertone серийную Alfa Romeo 2000 Sprint, а также концепты Piranha, Canguro и знаменитый Testudo.&nbsp;<br />Именно форма и пластика Testudo становится своеобразной квинтэссенцией стиля второй половины 60-х, прошедшей под знаком нового маэстро фирмы &laquo;Bertone&raquo; - Марчелло Гандини. &laquo;Это было прекрасное время, - вспоминал Марчелло. &ndash; Работать по 22 часа в сутки, вносить как минимум два принципиальных изменения в день и получать зарплату меньше всех&raquo;. В этот период рождаются и неудачная Alfa Romeo Montreal, и автомобиль, который принес Гандини мировую славу, - Lamborghini Miura. На разработку машины, выражавшей новую идеологию большого туризма, заказчик отпустил всего четыре месяца. Нужно было спешить, ибо конкуренты Ferrari и Maserati ждать не собирались. Несмотря на очень мягкие очертания Miura, что было непривычно для суперкаров, обычно отличавшихся резкостью линий и агрессивностью, автомобиль покорил всех. Это был звездный час Гандини, и концепты выкатываются из ворот ателье в Грульяско, как с конвейера. И самое поразительное, что практически каждый из них станет в дальнейшем прототипом серийного автомобиля! Так, концепт Autobianci A112 Runabout через три года нашел свое воплощение в дизайне Fiat X1/9, а Carabo определил пластическую тему легендарного Countach. К слову, Countach, а также Stratos стали любимейшими творениями Гандини. Спустя многие годы маэстро всегда находил в остальных работах то, что можно было исправить, эти же два автомобиля он считал совершенными.&nbsp;<br />В 1971 г. Бертоне строит новый центр стиля в местечке Каприе близ Турина. Отдаленность от города не была случайной. Большой противник различных социальных волнений, Нуччо таким образом старался уберечь от общественных потрясений и своих стилистов.&nbsp;<br />В 1979 г., в связи с уходом Гандини на вольные хлеба, Бертоне приглашает на должность главного стилиста француза Марка Дечампа, работавшего на Renault. Дечамп - последняя из ключевых фигур, создававших фундамент сегодняшнего стиля Bertone, который безошибочно узнается всеми, кто хоть немного разбирается и понимает толк в автомобильном дизайне. Лучшими в то время становятся прототипы Aton - спайдер на агрегатах Lamborghini Urraco 1981 г. и Zabrus на платформе Citroen BX. Поражало то, что форма обеих машин, на первый взгляд, лепилась исключительно из плоскостей и прямых линий, но это была всего лишь мастерски выполненная иллюзия. На самом деле композиция состояла из тончайших нюансов плоскости и напряженной криволинейной поверхности, горизонтали и лекальной кривой. Высочайший уровень мастерства дизайнеров Bertone становился особенно очевидным тогда, когда найденный ими пластический ключ - в виде формального набора модных средств - использовали другие. У подражателей, казалось бы, все было так же, но рисунок навивал скуку, а пластика была невыразительной и безжизненной.</p>\r\n<br />\r\n<p>В середине 90-х Нуччо Бертоне решает качественно модернизировать дело, для чего создает и реализует программу &laquo;Design Machinе&raquo;, включающую в себя полную методику разработки стиля промышленного изделия (не только автомобиля), а также его производства. Первой проверкой для &laquo;Design Machinе&raquo; стал концепт Pickster. Система сработала четко и безотказно: машина была спроектирована и построена за 141 день! А всего за год команда из Грульяско разработала 31 масштабную модель, 22 полноразмерных макета, 13 макетов интерьера, построила 9 прототипов и выполнила один индивидуальный заказ. Все это было сделано благодаря усилиям 1500 конструкторов, технологов и стилистов. За это же время 1200 производственников изготовили 70 000 Opel Astra и Fiat Punto с кузовами кабриолет.</p>\r\n<br />\r\n<p>К концу 90-х главными стилистами фирмы становятся Лучиано Д`Амброзио и Эугенио Пальяно, которые привносят в почерк Bertone солидность и весомость формы с большой массой. Наилучшим образом новый почерк фирмы проявился в дизайне концепта Lancia Kayak 1996 г., Pickster и Alfa Romeo Bella 1999 г. Две последние машины Нуччо Бертоне уже не увидел - он умер в 1997 г. Получив это известие, многие решили, что пришел конец фирмы, конец великого Дома высокой автомобильной моды. Но этого, к счастью, не произошло.&nbsp;</p>', '88', '/templates/66-reborn/auto/images/bertone.gif'),
(24, 'Bitter', '<p>Эрих Биттер - основатель фирмы - родился в 1933 году в семье чистокровных немцев. Свои первые шаги в автомире Эрих начал со спорта, а его первым автомобилем стал NSU II. Затем, оседлав более резвые машины Porsche и Abart, молодой гонщик зарекомендовал себя с лучшей стороны. И все же, как бы там ни было хорошо, а спортивная карьера его не устраивала.</p>\r\n<br />\r\n<p>В 1969 году Эрих Биттер в свои 26 лет открыл собственное дело по продаже автозапчастей. Данное поле деятельности приносило неплохой доход, но и это не затянуло юношу с головой. Нужно было брать выше. Автомобиль, носящий его имя, - вот что было бы кстати. Он уже давно вынашивал мечту о производстве спортивной машины в итальянском стиле, но база при этом должна была быть от серийного немецкого авто. Казалось бы, так просто, но на то время весьма непривычно.</p>\r\n<br />\r\n<p>В принципе, что-то подобное уже было реализовано в Турине фирмой &laquo;Интермеханика&raquo; в 1970 году. Нечто итальянское, не то &laquo;купе&raquo;, не то &laquo;спайдер&raquo;, на базе американского Ford с мотором V8. Эрих Биттер решил сделать то же самое, но, используя связь с Опелем, и уже в 1971 году представил свое видение купе на базе Opel Diplomat. Результатом кропотливого труда стал автомобиль, имя которому &ndash; &laquo;Интермеханика-Индра&raquo;. Заключив выгодное соглашение о продаже, Эрих положил начало своей неугомонной карьере.</p>\r\n<br />\r\n<p>Первое боевое крещение молодой еще фирмы, заложенной на западе Германии, прошло успешно. И в том же 1971 году, используя все ту же базу от Opel, Эрих теперь уже планировал строить люксовые версии спортивных автомобилей. Заказ на поставку кузовов был дан компании &laquo;Frua&raquo; - итальянским мастерам стиля.</p>\r\n<br />\r\n<p>При создании спорткара главный упор делался, прежде всего, на снижение шумового фона и повышение, в то же время, ездовых качеств.</p>\r\n<br />\r\n<p>Дебют 4-местного купе Bitter CD состоялся в 1973 году во Франкфурте. Созданный на базе седана Opel Diplomat с V-образным 8-цилиндровым 5-литровым мотором мощностью 230 л.с. он был просто прекрасен. Итальянский шик и немецкая техничность как нельзя лучше отвечали не только скорости - 210 км/ч, но и тем требованиям, которые могли предъявить покупатели. В общем, автомобиль удался на славу. Но даже несмотря на это, Эрих Биттер все же решился на смену своего детища.&nbsp;<br />Так, с сентября 1979-го по декабрь 1980-го велась работа над новой моделью Bitter SC. Теперь уже Эрих использовал основу от Opel Senator и 3-литровый 6-цилиндровый рядный мотор мощностью 180/210 л.с.</p>\r\n<br />\r\n<p>В конце 1981 года Bitter выпустил открытую версию SC. Но и это еще не все. Успех начатого дела предсказало появление полноприводной модификации SC 4WD в 1982 году. Последующие два года преподнесли обновленное купе с 3.9-литровым мотором в 210 л.с. и новый 4-дверный 5-местный лимузин SC-sedan.</p>\r\n<br />\r\n<p>Казалось бы, что еще нужно? Живи и радуйся. Но и это Эриха не устраивало. И вот в 1984 году Биттер выставил прототип 2-местного открытого автомобиля Rally Roadster построенный на платформе Opel Manta, с 4-цилиндровым мотором на 2.2/2.6 литра и 165 лошадиными силами. И хотя проект был всего лишь поиском нового лица фирмы, именно он заставил отступить от заложенных традиций Биттера.</p>\r\n<br />\r\n<p>Во второй половине 80-х годов автомобили этой марки пережили кризис, который привел в 1986 году к выбору &ndash; &laquo;или-или&raquo;. Пришлось пересмотреть не только программу производства, но и связи. Единственным реальным партнером по кузовам стала итальянская &laquo;Ilsa Maggiora&raquo;, а по производству - австрийский &laquo;Steyr&raquo; (который и предложил свои мощности и финансы для появления нового автомобиля). Таким образом, фирма снова смогла стать на ноги.</p>\r\n<br />\r\n<p>Благодаря новым инвестициям во Франкфурте 1987 года Эрих Биттер показал проект Type-3 на базе Opel Omega. Трехлитровый 177-сильный мотор с автоматической 4-ступенчатой или 5-ступенчатой КПП и массой в 1490 кг. был способен разогнать машину до 227 км/ч.</p>\r\n<br />\r\n<p>Годом позже в Женеве с помощью все тех же итальянцев был засвечен новый 4-дверный седан. Далее, в 1990-91 годах, силами фирмы был усовершенствован 3.9-литровый мотор мощностью 230 л.с. Скоростные показатели теперь уже колебались в пределах 240 км/ч.</p>\r\n<br />\r\n<p>Финансовые трудности наконец-то сломали Эриха Биттера и заставили свернуть производство элегантных немецких машин. Но страстное желание выпускать и далее автомобили под собственным именем заставило искать новых инвесторов.</p>\r\n<br />\r\n<p>Поиски привели немецкого предпринимателя в Нью-Йорк, где он думал заполучить 7 миллионов долларов на производство своего нового седана Berlina. Привез он для показа и его прототип. Кузов был выполнен из стеклопластика, хотя в массовое производство планировался стальной вариант с капотом и крышкой багажника из композитного материала. А вот основа была от вполне реальной Opel Omega, но увеличенной чуть-чуть в длину. Сравнительно короткий капот плавно переходил в массивный бампер со встроенной, огромной (как у предков) облицовкой радиатора. Убирающиеся фары остались неотъемлемой чертой всех Bitter, что поддерживалось, прежде всего, верностью традициям.</p>\r\n<br />\r\n<p>В планах самого Биттера - производство этих седанов на немецкой кузовной фирме &laquo;Karmann&raquo;, а не в собственной мастерской с небольшим штатом работников. Доводкой двигателей будет заниматься &laquo;Irmscher&raquo;, а основные компоненты шасси поступят непосредственно от Opel. А вот единственным и твердым рынком сбыта была, есть и будет Америка.</p>\r\n<br />\r\n<p>Вот таким образом Биттер и его марка надеется в ближайшем будущем получить неплохую прибыль, ведь планируемая стоимость самой навороченной модели Berlina - $ 79 000.&nbsp;</p>', '93', '/templates/66-reborn/auto/images/bitter.gif'),
(25, 'Blonell', '', '97', ''),
(26, 'BMW', '<p>Немецкая фирма была основана в 1916 году Карлом Раппом и Густавом Отто и носила имя &laquo;Баварские авиационные заводы&raquo;. В то время никто не мог предположить, что авиакомпания превратится в автомобильного гиганта.</p>\r\n<br />\r\n<p>Большая часть довоенного развития BMW проходила под знаком производства авиационных силовых установок. Тогда же была разработана знаменитая рядная &laquo;шестерка&raquo; - силовой агрегат, созданный для авиапромышленности, но перешедший в дальнейшем на автомобильную базу.</p>\r\n<br />\r\n<p>В 1928 году BMW покупает автомобильный завод в Айзенахе (Тюрингия), а вслед за этим &ndash; и лицензию на производство автомарки DIXI. В 1933 году компания представляет лимузин с характерной для BMW дизайнерской деталью &ndash; радиаторной решеткой с двумя овалами. На спортивном поприще BMW также выделилась, выпустив небольшим тиражом (чуть меньше 500 экз.) модель 328, задавшую тон спортивным купе на долгий период.</p>\r\n<br />\r\n<p>Вторая мировая война полностью разрушила экономику Германии, и концерн BMW не был исключением. Часть производства оказалась на территории ГДР, а главный рынок сбыта &ndash; собственно Германия &ndash; отсутствовал по причине финансовой несостоятельности населения. Выходя из кризиса, бывшая авиационная компания налаживает сначала производство мотоциклов, а затем по лицензии Izetta выпуск мотоколясок с единственной дверью в передней части. В 1951 году компания выпускает первую послевоенную машину.</p>\r\n<br />\r\n<p>В 1959 году, пережив острый кризис из-за потерь в секторе больших лимузинов, компания ставит на поток первую модель, завоевавшую всеобщее признание &ndash; BMW 700.</p>\r\n<br />\r\n<p>Шестидесятые и семидесятые годы проходят в жестких темпах развития производства &ndash; этому способствовал и высокий спрос на мотоциклы, и быстрый экономический рост страны. В конце 70-х конструкторское бюро компании BMW начинают разработку двигателей с цифровым управлением, а в начале 80-х внедряют систему ABS. В 1988 году начинается производство первого немецкого послевоенного автомобиля, оснащенного 12-цилиндровым двигателем &ndash; родстера Z1.</p>\r\n<br />\r\n<p>Уверенно расширяясь, в течение 90-х годов прошлого века немецкая компания открывает большое количество своих представительств в точках земного шара. Тогда же покупает марку Rolls-Royce и заключает договор на поставку восьми- и двенадцатицилиндровых двигателей для этих авто.</p>\r\n<br />\r\n<p>В настоящее время BMW активно разрабатывает новые технологии, используя их в последних моделях своих автомобилей. Практически на всех международных автосалонах и выставках последних лет компания представляла свои новинки &ndash; это подтверждает тот факт, что все отделения фирмы безостановочно работают на благо водителей.</p>', '188', '/templates/66-reborn/auto/images/bmw.gif')";
$tableSchema[] = "INSERT INTO `".PREFIX."_auto_marka_osn` (`id`, `name`, `desc`, `view`, `icon`) VALUES
(180, 'Nissan', '<div class=movie>\r\n<div>\r\n<div>\r\n<div class=title>\r\n<p>Компания была образована в 1925 году в результате консолидации двух компаний &ndash; &laquo;Kwaishinsha Co&raquo; (выпускающей автомобили Dat) и &laquo;Jitsuo Jidosha Co&raquo; - и была названа &laquo;Dat Jidosha Seizo Co&raquo;. Сначала новообразованная фирма выпускала все транспортные средства под маркой Datsun. Первый легковой автомобиль был представлен в 1931. Во время Второй мировой войны фирма производила, в основном, грузовики и другую технику для армии. После оккупации заводы были остановлены и производство прекратилось до 1955 года.</p>\r\n<br />\r\n<p>Вновь развернув производство в 1960-е годы, компания первой из всех японских автопроизводителей осознала выгоду американского и европейского рынка сбыта. Спорткар Nissan Datsun 240 Z, созданный для продажи в Америке в 1969 году, вырвался на первое место в рейтинге продаж в своем классе. В конце 1970-х годов компания Nissan взялась за производство автомобилей высшей группы среднего класса, не позабыв и про внедорожники &ndash; Nissan Patrol знаменит в России как вечный джип.</p>\r\n<br />\r\n<p>В течение последних лет компания Nissan открыла дочерние предприятия в Соединенных Штатах, Германии, Австралии, Перу, Мексике.</p>\r\n<br /><br />Скандальная реклама Nissan Tiida</div>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<object style=width: 300px height: 300px width=300 height=300 data=http://img.mail.ru/r/video2/player_v2.swf?ver=6&amp;par=http://content.video.mail.ru/corp/auto/news/$737$0$98 type=application/x-shockwave-flash>\r\n<param name=src value=http://img.mail.ru/r/video2/player_v2.swf?ver=6&amp;par=http://content.video.mail.ru/corp/auto/news/$737$0$98 />\r\n</object>\r\n<br /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>', '1', '/templates/66-reborn/auto/images/nissan.gif'),
(27, 'Bristol', '<p>Компания была основана Сэром Джорджем Вайтом. С 1910 года она занималась производством летательных аппаратов.</p>\r\n<br />\r\n<p>После ВОВ &laquo;Bristol Aeroplane Co&raquo; получила из Германии, в порядке репараций, обширную техническую документацию мюнхенской фирмы BMW по серийным и перспективным авто, в том числе, спортивным BMW 327 и BMW 328. Было решено переоборудовать несколько цехов для производства легковых автомашин.</p>\r\n<br />\r\n<p>Сегодня фирма ориентируется на состоятельных покупателей и производит автомобили высшего класса с довольно богатой комплектацией. Компания выпускает около 100 машин в год. Компания &laquo;Bristol Cars Ltd&raquo; - одна из последних аристократичных автомобильных марок Англии.&nbsp;</p>', '93', '/templates/66-reborn/auto/images/bristol.gif'),
(28, 'Bugatti', '<p>Знаменитая французская компания по производству гоночных, спортивных и эксклюзивных автомобилей. Даже в узком кругу легендарных авто для Bugatti отведено специальное место.</p>\r\n<br />\r\n<p>Инженер и художник Этторе Бугатти основал компанию в 1909 г. В 20-е гг. всемирную известность Bugatti принесла модель Type 35 GP, одержавшая более полутора тысяч побед на автомогонках и прославившаяся в свое время как самая удачная модель гоночного класса Гран-при. Все во внешности этого автомобиля служило одной цели &ndash; высокой скорости. Автомобиль был очень устойчив на трудных трассах благодаря блестящему сочетанию технической элегантности и хорошо сбалансированных характеристик управляемости. Ведущие автомобильные критики того времени разнесли в пух и прах первую конструкцию Bugatti с восьмицилиндровым силовым агрегатом, модель 30 выпуска 1922 года, назвав его неэстетичным, шумным и не особенно быстроходным.</p>\r\n<br />\r\n<p>В 1963 г. предприятия Бугатти отошли к фирме &laquo;Hispano Suiza&raquo;, не занимавшейся уже автомобилями.</p>\r\n<br />\r\n<p>В конце 80-х гг. фирма пережила второе рождение. Вновь всплывает прославленное имя Bugatti, когда среди супермашин, стремящихся преодолеть барьер 300 км/час, появляется мощный и неординарный спортивный автомобиль.</p>\r\n<br />\r\n<p>В 1999 году торговая марка &laquo;Bugatti&raquo; была куплена концерном VW, который в 2006 году планирует вновь запустить в производство французские супер-кары: готовится к выпуску модель Veyron.&nbsp;</p>', '96', '/templates/66-reborn/auto/images/bugatti.gif'),
(29, 'Buick', '<p>Дэвид Данбар Бьюик в 1903 году основал автомобилестроительную компанию &laquo;Buick Motor Car Company&raquo;.</p>\r\n<br />\r\n<p>В 1903 г. повился на свет первый автомобиль марки &laquo;Buick&raquo;. В 1908 г. компания одной из первых присоединилась к концерну GM, но осталась ее самостоятельным подразделением. Удачная конструкция Buick обратила на себя внимание американских покупателей. Установлен рекорд продаж компании &ndash; 8 800 автомобилей. В том же 1908 году начался выпуск модели 10 с 4-цилиндровым двигателем, снискавшей широкую популярность. Первый 6-цилиндровый Buick появился в 1914 году, а 8-цилиндровый - в 1931.</p>\r\n<br />\r\n<p>В 30-х годах модели Buick наряду с Chevrolet и Pontiac стали символами американского стиля в автомобилестроении. Модель 66S 1934 года имела новый стосильный двигатель и независимую подвеску передних колес. В годы Второй Мировой войны компания производила военное снаряжение.</p>\r\n<br />\r\n<p>Сейчас отделение &laquo;Buick&raquo; концерна General Motors строит относительно недорогие однотипные, полноразмерные переднеприводные автомобили среднего класса для американского рынка.&nbsp;</p>', '85', '/templates/66-reborn/auto/images/buick.gif'),
(30, 'Byd', '....', '85', '/templates/66-reborn/auto/images/byd.gif'),
(171, 'ВАЗ', '<p>Волжский автомобильный завод (АВТОВАЗ) - российская фирма, являющаяся лидером отечественного автопрома на протяжении многих лет.<br /><br />Завод находится в городе Тольятти (Самарская область). Его строительство началось в далёком теперь 1967 году. Первая линия, рассчитанная на выпуск 220 000 авто в год, вступила в строй в 1971 году. Первым транспортным средством, сошедшим с конвейера ВАЗа, стала модель 2101, созданная на базе итальянского автомобиля Fiat-124. &laquo;Копейка&raquo;, а именно так прозвали в народе первенца завода, на долгие года стала поистине массовой машиной для многих советских граждан. В 1977 у ВАЗа появилась принципиально новая модель &ndash; полноприводный автомобиль Нива - ВАЗ-2121. Шли годы, тольяттинские авто совершенствовались, осваивался выпуск новых заднеприводных и переднеприводных моделей, разрабатывались экспортные варианты автомашин. После распада Советского Союза АвтоВАЗ, как и многие другие промышленные гиганты, вступил в полосу полной перестройки своей деятельности. Кризис оказался довольно затяжным, но завод всё-таки сумел переломить ситуацию и постепенно стал наращивать производство транспортных средств. В конце 90-х с конвейера сошло новое &ndash; десятое семейство автомобилей.</p>\r\n<br />\r\n<p>Сейчас АвтоВАЗ активно развивается и с уверенностью смотрит в будущее: обновляет модельный ряд, строит перспективные авто (Lada Kalina, Lada Priora), сотрудничает с концерном GM.</p>\r\n<br />\r\n<p>В данный момент большая часть акций тольяттинского автогиганта принадлежит альянсу Renault-Nissan, который и будет заниматься дальнейшим развитием завода и постепенным переводом ВАЗа на новые промышленные рельсы.</p>', '125', '/templates/66-reborn/auto/images/vaz.gif'),
(172, 'ГАЗ', '<div class=title>\r\n<p>Горьковский Автомобильный Завод - крупнейший и старейший автозавод нашей страны. Решение о строительстве автогиганта было принято в 1929 году. 1 января 1931 года завод уже был принят в эксплуатацию, а через год (в конце января 1932 года) был выпущен первый автомобиль - грузовик НАЗ-АА. В 1970 году началось производство легковой автомашины &laquo;Газ-24 &laquo;Волга&raquo;. В марте 1981 года на заводе был выпущен 10 миллионный автомобиль. В 1992 году ГАЗ преобразован в акционерное общество открытого типа. В 2000 году на заводе был выпущен 16 миллионный автомобиль.</p>\r\n<br />\r\n<p>За годы существования предприятия освоено около 400 различных моделей и модификаций автомобилей, изготовлено свыше 16 миллионов легковых и грузовых машин.</p>\r\n<br />\r\n<p>В данный момент завод находится под контролем компании &laquo;РусПромАвто&raquo; и производит легкие коммерческие авто, грузовые автомобили, автобусы, легковые авто, строительную и дорожную технику, погрузчики, специальные транспортные средства, дизельные и бензиновые двигатели, дизельную топливную аппаратуру, автокомпоненты.</p>\r\n<br />\r\n<p>Сейчас в состав группы &laquo;Руспромавто&raquo; входят:&nbsp;<br />1. ОАО &laquo;ГАЗ&raquo;.&nbsp;<br />2. ОАО &laquo;Павловский автобус&raquo;.&nbsp;<br />3. ОАО &laquo;Голицынский автобусный завод&raquo;.&nbsp;<br />4. ОАО &laquo;Канашский автоагрегатный завод&raquo;.&nbsp;<br />5. ОАО &laquo;Саранский завод автосамосвалов&raquo;.&nbsp;<br />6. ОАО &laquo;Ярославский завод дизельной аппаратуры&raquo;.&nbsp;<br />7. ОАО &laquo;Автодизель&raquo; (Ярославский моторный завод).&nbsp;<br />8. ООО &laquo;Ликинский автобус&raquo;.&nbsp;<br />9. ООО &laquo;КАВЗ&raquo;.&nbsp;<br />10. ОАО &laquo;Ярославский завод топливной аппаратуры&raquo;.</p>\r\n<br />\r\n<p>Несмотря на славное и героическое прошлое ГАЗа будущее его легковых автомобилей немного туманно: несколько лет назад&nbsp;руководство автозавода заявило о намерении в ближайшем будущем&nbsp;уменьшить объём&nbsp;производства легковых автомашин &laquo;Волга&raquo; и сосредоточиться на выпуске коммерческой техники марки LDV. Кроме этого, недавно было заявлено о начале производства новейшего седана Siber, собранного на базе американского Chrysler Sebring, который, видимо, и станет приемником &laquo;Волги&raquo;.</p>\r\n<br /><br />ГАЗ Siber</div>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<object style=width: 400px; height: 400px; width=400 height=400 data=http://img.mail.ru/r/video2/player_v2.swf?ver=6&amp;par=http://content.video.mail.ru/corp/auto/testdrive/$294$0$143 type=application/x-shockwave-flash>\r\n<param name=src value=http://img.mail.ru/r/video2/player_v2.swf?ver=6&amp;par=http://content.video.mail.ru/corp/auto/testdrive/$294$0$143 />\r\n</object>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '93', '/templates/66-reborn/auto/images/gaz.gif'),
(173, 'ЗАЗ', '<p>Начало истории Запорожского Aвтомобильного Завода положено в 1863 году с четырех небольших мастерских колониста Я. Коопа, выпускающих сельскохозяйственные машины и оборудование. После революции в 1921 году завод начал работу под именем Коммунар и продолжал выпуск сельскохозяйственных машин. После ВОВ - 18 июня 1959 года - вышел первый опытный автомобиль &laquo;ЗАЗ-965 &laquo;Запорожец&raquo;, который одно время был культовым у автолюбителей Советского Союза.&nbsp;<br />В 1988 году начался выпуск автомобилей &laquo;Таврия&raquo;. Данное простое и весьма примитивное транспортное средство пользовалось популярностью в СССР не один год и разошлось значительным тиражом.</p>\r\n<br />\r\n<p>В мае 1998 года образовалось совместное украино-корейское предприятие под названием &laquo;АвтоЗАЗ- Daewoo&raquo;.</p>\r\n<br />\r\n<p>В 1999 году налажен выпуск автомобиля ЗАЗ-1103 &laquo;Славута&raquo;. В декабре 2003 года началась сборка автомобилей ВАЗ.</p>\r\n<br />\r\n<p>Сейчас крупный автозавод производит слегка обновленную модель &laquo;Таврия&raquo; (хэтчбек) и псевдоседан на ее базе &ndash; &laquo;Славута&raquo;, а также их множественные модификации; ведет сборку машин концерна GM - Chevrolet Lanos, Chevrolet Aveo, Chevrolet Lacetti, Chevrolet Tacuma, Chevrolet Evanda; собирает автомобили ВАЗ 21093 и ВАЗ 21099; занимается отвёрточной сборкой машин Opel Astra, Opel Vectra и Opel Meriva; осуществляет выпуск, методом крупноузловой сборки, автомобилей марки Mercedes-Benz &ndash; модели A, C, E, S и ML &ndash; классов.&nbsp;</p>', '85', '/templates/66-reborn/auto/images/zaz.gif'),
(174, 'ИЖ', '<p>В июне 1965 года было принято решение о создании на базе Ижевского машиностроительного завода отделения по выпуску автомобилей. Официальной датой рождения автозавода считается 21 октября 1965 года, когда были начаты работы по подготовке производства. Первым автомобилем стал Москвич-408 с эмблемой ИЖ - он сошел с конвейера 12 декабря 1966 года.</p>\r\n<br />\r\n<p>В декабре 1967 года на заводе начали выпуск машины Москвич-412, а 27 октября 1977 года с конвейера завода в Ижевске сошел миллионный автомобиль.</p>\r\n<br />\r\n<p>В 1984 году был начат выпуск автомобиля ИЖ-2126 &laquo;Орбита&raquo;, позже переименованная в &laquo;Оду&raquo;. В 2005 году &laquo;ИжАвто&raquo; решил прекратить производство &laquo;Оды&raquo;. А в августе 2005 года с конвейера ОАО &laquo;ИжАвто&raquo; сошла первая партия корейских автомобилей Kia Spectra.</p>\r\n<br />\r\n<p>В данный момент Группа СОК, которой принадлежит &laquo;ИЖ&raquo;, ведёт перегововы с альянсом Renault-Nissan о продаже автопредприятия.</p>', '83', '/templates/66-reborn/auto/images/iz.gif'),
(175, 'КАМАЗ', '<p>В середине 1969 г. было принято Постановление ЦК КПСС и Совета Министров СССР о строительстве комплекса заводов по производству большегрузных автомобилей в Набережных Челнах. На стройку в город съехались рабочие и специалисты из всех уголков Советского Союза.</p>\r\n<br />\r\n<p>13 декабря 1969 г. был начато строительство Камского автозавода, который был рассчитан на производство 150 000 большегрузных автомобилей и 250 000 двигателей в год.</p>\r\n<br />\r\n<p>16 февраля 1976 г. с главного сборочного конвейера автомобильного завода сошел первый камский грузовик. Правительство СССР утвердило генеральную схему управления автомобильной промышленностью. Согласно этой схеме Камский автомобильный завод получил статус производственного объединения и стал подчиняться непосредственно Минавтопрому СССР.&nbsp;<br />25 июня 1990 г. - правительство приняло решение о создании акционерного общества &laquo;КАМАЗ&raquo; на базе имущества производственного объединения. Устав акционерного общества был утвержден на общем собрании 11 августа 1990 года. Открытое акционерное общество &laquo;КАМАЗ&raquo; создано 23 августа 1990 года путем преобразования производственного объединения &laquo;КАМАЗ&raquo; и &laquo;Министерства автомобильного и сельскохозяйственного машиностроения СССР&raquo; в акционерное общество открытого типа.</p>\r\n<br />\r\n<p>30 августа 1999 г. с конвейера был выпущен 1600000-й большегрузный автомобиль.</p>\r\n<br />\r\n<p>На сегодняшний день группа ОАО &laquo;КАМАЗ&raquo; - это единый производственный комплекс, расположенный в городе Набережные Челны, включающий в себя 9 крупных специализированных заводов.&nbsp;</p>', '86', '/templates/66-reborn/auto/images/kamaz.gif'),
(176, 'Москвич', '<p>В октябре 1929 года было начато строительство Московского автосборочного завода. С ноября 1930 года стартовал выпуск американских автомобилей Ford-А и Ford-АА. В декабре 1930 года завод был переименован в &laquo;Государственный автосборочный завод имени КИМ. В 1933 году автосборочный завод им. КИМ стал филиалом Горьковского автозавода и перешёл на выпуск машины ГАЗ-АА. В 1939 году он становится &laquo;Московским автомобильным завод имени КИМ&raquo;. В 1945 году произошло новое переименование в &laquo;Московский завод малолитражных автомобилей&raquo; (МЗМА).</p>\r\n<br />\r\n<p>В 1947 году начат выпуск автомобиля &laquo;Москвич-400&raquo;. В 1968 предприятие вновь переименовано, теперь в &laquo;Автомобильный завод имени Ленинского комсомола&raquo; &ndash; АЗЛК. В сентябре 1971 году образовано автомобильное производственное объединение &laquo;Авто-Москвич&raquo;.</p>\r\n<br />\r\n<p>За годы функционирования предприятия произведена масса моделей транспортных средств: Москвич-400 (1947 г.), Москвич-401 (1954 г.), Москвич-402 (1956 г.), Москвич-407 (1958 г.), Москвич 412 (1967 г.), Москвич-2140 (1975 г.), Москвич-2141 (1988 г.).</p>\r\n<br />\r\n<p>В январе 1997 года завод освоил выпуск новой модели &laquo;Юрий Долгорукий&raquo; (на базе модели 2141) с моторами ВАЗ и Renault. В июне того же года начался выпуск модели &laquo;Князь Владимир&raquo; с двигателем Renault.</p>\r\n<br />\r\n<p>Вскоре модельный ряд был пополнен моделью &laquo;Калита&raquo; с двигателем Renault, а в ноябре 98-го разработана полноприводная модель автомобиля &laquo;Калита&raquo;.</p>\r\n<br />\r\n<p>К марту 1999 года разработаны автомобили с кузовом купе &ndash; &laquo;Дуэт-1&raquo; и &laquo;Дуэт-2&raquo;.</p>\r\n<br />\r\n<p>В 2000 году предприятие резко снизило темпы производства, а к 2002 году завод перестал функционировать. Бездействует он и по сей день, однако московское правительство не оставляет надежд на возрождение Москвича.&nbsp;</p>', '86', '/templates/66-reborn/auto/images/mosk.gif'),
(177, 'УАЗ', '<p>Ульяновский автомобильный завод - российская компания по производству легковых и грузовых автомобилей.</p>\r\n<br />\r\n<p>Завод был основан в 1942 году на базе эвакуированной части оборудования московского завода ЗИЛ. Уже в феврале того же года были собраны первые авто, а в 1943 году их выпуск достиг уже 4 000. После ВОВ был налажен выпуск знаменитых УАЗиков на базе &laquo;ГАЗ-69&raquo;. В 1972 завод перешел на массовый выпуск внедорожников &laquo;УАЗ-469&raquo; и &laquo;УАЗ-469&raquo; Б.</p>\r\n<br />\r\n<p>В годы застоя УАЗ обеспечивал Советскую армию и армии стран Варшавского договора довольно надежными и неприхотливыми внедорожниками, которые эксплуатировались как в условиях хороших дорог, так и в непролазной грязи. После распада Советского Союза для завода наступили тяжелые времена. И все же УАЗ выбрался из кризиса и стал постепенно наращивать объёмы производство своих автомобилей.</p>\r\n<br />\r\n<p>В 2003 год начато производство автомобилей УАЗ во Вьетнаме, а в августе 2005 стартовало серийное производство принципиально нового внедорожника UAZ Patriot, которому под силу конкурировать со многими иностранными автомобилями повышенной проходимости. Сейчас завод работает над новыми модификациями &laquo;Патриота&raquo; и повышением качества сборки данных внедорожников.</p>', '95', '/templates/66-reborn/auto/images/uaz.gif'),
(178, 'Toyota', '<p>В 1930 году Киичиро Тойода начал разработку компактного бензинового мотора для автомобилей. В 1933 году открылось автоотделение фирмы &laquo;Toyoda Automatic Loom Works Ltd&raquo;, на котором в 1936 году было обьявлено о выпуске Toyoda Model AA. В 1937 году была открыта компания &laquo;Toyota Motor Co. Ltd&raquo;. Компания входит ныне в состав финансово-промышленной группы &laquo;Toyota&raquo;. Фирма по праву считается одним из лидеров мирового автомобилестроения. Кроме торговой марки Toyota фирма выпускает автомобили под брэндом Lexus.</p>\r\n<br />\r\n<p>Первый автомобиль &ndash; кабриолет на шасси от Chevrolet - был гибридом моделей Chrysler и Ford. Модель, успешно продававшаяся до войны, выпускалась и в послевоенный период с некоторыми модификациями. В 1958 году компания начала осуществлять продажи в США, а четыре года спустя &ndash; в Европе. Первой моделью, попавшей на европейский рынок, оказалась Corolla 1100. Темпы продаж резко пошли вверх - качество и дизайн были сравнимы с европейскими и американскими марками, а цена - намного ниже. В 1967 году к Toyota присоединяется Daihatsu Motor Company. Добившись устойчивого роста, компания начала осваивать рынок внедорожных и спортивных автомобилей. Мало кто из владельцев Toyota Land Cruiser знает, что прототип знаменитого внедорожника появился аж в 1951 году.</p>\r\n<br />\r\n<p>В конце 90-х годов компанией &laquo;Toyota Motor Corporation&raquo; был выпущен 100-миллионный автомобиль.</p>\r\n<br />\r\n<p>В настоящее время Toyota активно развивается и сотрудничает с партнёрами по всему миру. В 2005 году было принято решение о строительстве завода в России. В нашей стране компания планирует собирать седаны бизнес класса Camry.</p>', '33', '/templates/66-reborn/auto/images/toyota.gif'),
(179, 'Ford', '<p>Американская автомобильная компания, выпускающая легковые авто марок Ford, Mercury, Lincoln и т.д., грузовики, разнообразную сельхозтехнику. Концерну также принадлежат компания Jaguar, Mazda и Land Rover.</p>\r\n<br />\r\n<p>Генри Форд основал компанию &laquo;Ford Motor Company&raquo; в 1903 г. В 1911 г. в Великобритании открыта дочерняя компания Ford, построен сборочный завод. &laquo;Ford Motor Company&raquo; принадлежит огромное число инноваций в производстве автомобилей. Так, в 1913 г. впервые в мире на автомобилестроительном предприятии внедрена конвейерная сборка.</p>\r\n<br />\r\n<p>К концу 1913 г. &laquo;Ford Motor Company&raquo; производила половину всех автомобилей в Америке. Чтобы удовлетворять высокий спрос на свои авто, Форд ввел на фабрике массовое производство. Он справедливо полагал, что если каждый рабочий будет оставаться на одном месте и выполнять одну определенную операцию, то автомобиль будет собран быстрее, а часы человеческого труда сократятся.</p>\r\n<br />\r\n<p>В 2000 г. Международное жюри из 126 автомобильных журналистов, подведя итоги беспрецедентного конкурса &laquo;Автомобиль века&raquo;, избрало машиной всех времен и народов легендарный &laquo;Ford Т. Tin Lizzie&raquo; (Жестянка Лиззи), Данная модель стала первым авто, сборка которого была налажена на конвейере в массовых масштабах. Новый метод позволил начать крупносерийное изготовление машин, улучшить их качество и резко снизить себестоимость. Именно конвейерная сборка сделала автомобиль средством передвижения, доступным для всех. И первой в ряду действительно серийных машин стояла фордовская модель.</p>\r\n<br />\r\n<p>Сегодня у Ford есть свои производственные, сборочные и торговые центры в 30 странах мира (в том числе и в России). Компания ежегодно производит миллионы легковых автомобилей, грузовиков и тракторов. В большой тройке американского автомобильного бизнеса Ford занимает почетное второе место по объемам продаж.<br /><br />\r\n<div class=title>Ford S-Max</div>\r\n</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<object style=width: 400px; height: 400px; width=400 height=400 data=http://img.mail.ru/r/video2/player_v2.swf?ver=6&amp;par=http://content.video.mail.ru/corp/auto/catalog/$749$0$94 type=application/x-shockwave-flash>\r\n<param name=src value=http://img.mail.ru/r/video2/player_v2.swf?ver=6&amp;par=http://content.video.mail.ru/corp/auto/catalog/$749$0$94 />\r\n</object>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '42', '/templates/66-reborn/auto/images/ford.gif')";

